import React from 'react'

const Home = () => {
  return (
    <div>
       {/* HEADER */}
      <header>
        {/* TOP HEADER */}
        <div id="top-header">
          <div className="container">
            <ul className="header-links pull-left">
              <li><a href="#"><i className="fa fa-phone"></i> +021-34-56-784</a></li>
              <li><a href="#"><i className="fa fa-envelope-o"></i> email@email.com</a></li>
              <li><a href="#"><i className="fa fa-map-marker"></i> Address</a></li>
            </ul>
            <ul className="header-links pull-right">
              <li><a href="#"><i className="fa fa-user-o"></i> My Account</a></li>
            </ul>
          </div>
        </div>
        {/* /TOP HEADER */}

        {/* MAIN HEADER */}
        <div id="header">
          {/* container */}
          <div className="container">
            {/* row */}
            <div className="row">
              {/* LOGO */}
              <div className="col-md-3">
                <div className="header-logo">
                  <a href="#" className="logo">
                    <img src="./img/logo.png" alt="" />
                  </a>
                </div>
              </div>
              {/* /LOGO */}

              {/* SEARCH BAR */}
              <div className="col-md-6">
                <div className="header-search">
                <form>
								<input className="input" type="email" placeholder="Enter Your Email"/>
								<button class="newsletter-btn"><i class="fa fa-envelope"></i> Subscribe</button>
							</form>
                  <form>
                    {/* <select className="input-select">
                      <option value="0">All Categories</option>
                      <option value="1">Category 01</option>
                      <option value="1">Category 02</option>
                    </select> */}
                    <input className="input" type="email" placeholder="Enter Your Email"></input>
                    {/* <input className="input" placeholder="Search here" /> */}
                    <button className="search-btn">Search</button>
                  </form>
                </div>
              </div>
              {/* /SEARCH BAR */}

              {/* ACCOUNT */}
              <div className="col-md-3 clearfix">
                <div className="header-ctn">
                  {/* Wishlist */}
                  <div>
                    <a href="#">
                      {/* <i className="fa fa-heart-o"></i> */}
                      <i className="fa fa-user-o"></i>
                      <span>Login</span>
                      {/* <div className="qty">2</div> */}
                    </a>
                  </div>
                  {/* /Wishlist */}

                  {/* Cart */}
                  <div className="dropdown">
                    <a className="dropdown-toggle" data-toggle="dropdown" aria-expanded="true">
                      {/* <i className="fa fa-shopping-cart"></i> */}
                      <i className="fa fa-user-o"></i>
                      <span>signup</span>
                     
                    </a>
                  
                  </div>
                  {/* /Cart */}

                  {/* Menu Toogle */}
                  <div className="menu-toggle">
                    <a href="#">
                      <i className="fa fa-bars"></i>
                      <span>Menu</span>
                    </a>
                  </div>
                  {/* /Menu Toogle */}
                </div>
              </div>
              {/* /ACCOUNT */}
            </div>
            {/* /row */}
          </div>
          {/* /container */}
        </div>
        {/* /MAIN HEADER */}
      </header>
      {/* /HEADER */}

      {/* NAVIGATION */}
      <nav id="navigation">
        {/* container */}
        <div className="container">
          {/* responsive-nav */}
          <div id="responsive-nav">
            {/* NAV */}
            <ul className="main-nav nav navbar-nav">
              <li className="active"><a href="#">Home</a></li>
              {/* <li><a href="#">Hot Deals</a></li>
              <li><a href="#">Categories</a></li>
              <li><a href="#">Laptops</a></li>
              <li><a href="#">Smartphones</a></li>
              <li><a href="#">Cameras</a></li>
              <li><a href="#">Accessories</a></li> */}
            </ul>
            {/* /NAV */}
          </div>
          {/* /responsive-nav */}
        </div>
        {/* /container */}
      </nav>
      {/* /NAVIGATION */}

     
    </div>
  )
}

export default Home
